// SPDX-License-Identifier: MIT
pragma solidity ^0.8.19;

import "@openzeppelin/contracts/token/ERC721/extensions/ERC721URIStorage.sol";
import "@openzeppelin/contracts/utils/Counters.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/utils/Base64.sol";
import "@openzeppelin/contracts/utils/Strings.sol";

contract ReflexBlitzNFT is ERC721URIStorage, Ownable {
    using Counters for Counters.Counter;
    using Strings for uint256;
    
    Counters.Counter private _tokenIds;
    
    // 
    string[] private ranks = ["S+", "S", "A", "B", "C", "D"];
    
    // 
    uint256[] private rankThresholds = [
        100000,  // 100ms: S+
        150000,  // 150ms: S
        200000,  // 200ms: A
        250000,  // 250ms: B
        300000,  // 300ms: C
        500000   // : D
    ];
    
    // ReflexBlitz
    address public gameAddress;
    
    // ID
    mapping(address => uint256[]) public userTokens;
    
    // ID
    mapping(uint256 => uint256) public tokenReactionTimes;
    
    // 
    event NFTMinted(address indexed player, uint256 tokenId, uint256 reactionTime, string rank);
    
    constructor() ERC721("ReflexBlitz Achievement", "REFLEX") Ownable() {
        // OpenZeppelin Contracts v4.x Ownable() 
        // msg.sender 
    }
    
    // 
    function setGameAddress(address _gameAddress) external onlyOwner {
        gameAddress = _gameAddress;
    }
    
    // NFT
    function mintNFT(address player, uint256 reactionTimeMicroseconds) external returns (uint256) {
        require(msg.sender == gameAddress || msg.sender == owner(), "Only game contract or owner can mint");
        
        _tokenIds.increment();
        uint256 newTokenId = _tokenIds.current();
        
        _mint(player, newTokenId);
        
        tokenReactionTimes[newTokenId] = reactionTimeMicroseconds;
        userTokens[player].push(newTokenId);
        
        string memory tokenURI = generateTokenURI(newTokenId, reactionTimeMicroseconds);
        _setTokenURI(newTokenId, tokenURI);
        
        string memory rank = determineRank(reactionTimeMicroseconds);
        emit NFTMinted(player, newTokenId, reactionTimeMicroseconds, rank);
        
        return newTokenId;
    }
    
    // 
    function determineRank(uint256 reactionTime) public view returns (string memory) {
        for (uint i = 0; i < rankThresholds.length; i++) {
            if (reactionTime <= rankThresholds[i]) {
                return ranks[i];
            }
        }
        return ranks[ranks.length - 1]; // 
    }
    
    // SVG
    function generateSVG(uint256 tokenId, uint256 reactionTime) private view returns (string memory) {
        string memory reactionTimeStr = (reactionTime / 1000).toString();
        string memory reactionMs = string(abi.encodePacked(reactionTimeStr, ".", (reactionTime % 1000).toString())); 
        string memory rank = determineRank(reactionTime);
        
        // 
        string memory color;
        if (keccak256(abi.encodePacked(rank)) == keccak256(abi.encodePacked("S+"))) {
            color = "gold";
        } else if (keccak256(abi.encodePacked(rank)) == keccak256(abi.encodePacked("S"))) {
            color = "silver";
        } else if (keccak256(abi.encodePacked(rank)) == keccak256(abi.encodePacked("A"))) {
            color = "#ff9900";
        } else if (keccak256(abi.encodePacked(rank)) == keccak256(abi.encodePacked("B"))) {
            color = "#6666ff";
        } else if (keccak256(abi.encodePacked(rank)) == keccak256(abi.encodePacked("C"))) {
            color = "#33cc33";
        } else {
            color = "#cc33cc";
        }
        
        // SVG
        return string(
            abi.encodePacked(
                '<svg xmlns="http://www.w3.org/2000/svg" width="350" height="350" viewBox="0 0 350 350">',
                '<rect width="100%" height="100%" fill="#1f2937" />',
                '<text x="175" y="50" font-family="Arial" font-size="20" text-anchor="middle" fill="white">Reflex Blitz Achievement</text>',
                '<circle cx="175" cy="140" r="50" fill="', color, '" />',
                '<text x="175" y="140" font-family="Arial" font-size="40" font-weight="bold" text-anchor="middle" fill="white">', rank, '</text>',
                '<text x="175" y="200" font-family="Arial" font-size="16" text-anchor="middle" fill="white">Reaction Time</text>',
                '<text x="175" y="230" font-family="Arial" font-size="30" font-weight="bold" text-anchor="middle" fill="white">', reactionMs, ' ms</text>',
                '<text x="175" y="270" font-family="Arial" font-size="14" text-anchor="middle" fill="white">Token #', tokenId.toString(), '</text>',
                '<text x="175" y="320" font-family="Arial" font-size="12" text-anchor="middle" fill="#a0aec0">Minted on Monad Testnet</text>',
                '</svg>'
            )
        );
    }
    
    // URI
    function generateTokenURI(uint256 tokenId, uint256 reactionTime) private view returns (string memory) {
        string memory svg = generateSVG(tokenId, reactionTime);
        string memory json = Base64.encode(
            bytes(
                string(
                    abi.encodePacked(
                        '{"name": "ReflexBlitz #',
                        tokenId.toString(),
                        '", "description": "ReflexBlitz achievement NFT showing reaction time of ',
                        (reactionTime / 1000).toString(),
                        '.',
                        (reactionTime % 1000).toString(),
                        ' milliseconds. Rank: ',
                        determineRank(reactionTime),
                        '", "image": "data:image/svg+xml;base64,',
                        Base64.encode(bytes(svg)),
                        '", "attributes": [{"trait_type": "Reaction Time (ms)", "value": ',
                        (reactionTime / 1000).toString(),
                        '}, {"trait_type": "Rank", "value": "',
                        determineRank(reactionTime),
                        '"}]}'
                    )
                )
            )
        );
        return string(abi.encodePacked("data:application/json;base64,", json));
    }
    
    // NFT
    function getTokensByUser(address user) external view returns (uint256[] memory) {
        return userTokens[user];
    }
    
    // NFT
    function getReactionTime(uint256 tokenId) external view returns (uint256) {
        require(_exists(tokenId), "Token does not exist");
        return tokenReactionTimes[tokenId];
    }
}

