// SPDX-License-Identifier: MIT
pragma solidity ^0.8.19;

// NFT
interface IReflexBlitzNFT {
    function mintNFT(address player, uint256 reactionTimeMicroseconds) external returns (uint256);
}

contract VRFReflexBlitz {
    address public owner;
    IReflexBlitzNFT public nftContract; // NFT

    struct PlayerState {
        uint256 flashRequestTimestamp; // Timestamp of the flash request (block.timestamp)
        bool flashActive; // Is a flash currently active for this player?
    }

    mapping(address => PlayerState) public playerStates;

    uint256 public constant MAX_REACTION_TIME_SECONDS = 5; // Max allowed reaction time

    // Events
    event FlashRequested(
        address indexed player,
        uint256 requestTimestamp // block.timestamp when flash was requested
    );

    event TapResult(
        address indexed player,
        bool success,
        uint256 reactionTimeMicroseconds // Reaction time in microseconds
    );
    
    // NFT
    event NFTMinted(address indexed player, uint256 tokenId, uint256 reactionTimeMicroseconds);

    modifier onlyOwner() {
        require(msg.sender == owner, "Not the owner");
        _;
    }

    constructor() {
        owner = msg.sender;
    }
    
    // NFT
    function setNFTContract(address _nftContractAddress) external onlyOwner {
        nftContract = IReflexBlitzNFT(_nftContractAddress);
    }

    function requestFlash() external {
        playerStates[msg.sender] = PlayerState({
            flashRequestTimestamp: block.timestamp,
            flashActive: true
        });
        emit FlashRequested(msg.sender, block.timestamp);
    }

    function submitTap(uint256 reactionTimeMicroseconds) external {
        PlayerState storage player = playerStates[msg.sender];
        require(player.flashActive, "No flash active for this player or already tapped.");
        // Basic check: ensure the tap is not excessively late based on block timestamps
        // This is a very rough check as block.timestamp is in seconds.
        // The main timing logic relies on frontend submitting reactionTimeMicroseconds.
        require(block.timestamp >= player.flashRequestTimestamp, "Tap too early based on block time.");
        // require(block.timestamp <= player.flashRequestTimestamp + MAX_REACTION_TIME_SECONDS, "Tap too late based on block time.");

        player.flashActive = false; // Consume the flash

        // For now, success is always true if the tap is submitted while active.
        // Actual success (within time window) will be determined by reactionTimeMicroseconds on the frontend or later analysis.
        emit TapResult(msg.sender, true, reactionTimeMicroseconds);
    }
    
    // NFT
    function mintAchievementNFT(uint256 reactionTimeMicroseconds) external {
        require(address(nftContract) != address(0), "NFT contract not set");
        
        // NFT
        uint256 tokenId = nftContract.mintNFT(msg.sender, reactionTimeMicroseconds);
        
        // 
        emit NFTMinted(msg.sender, tokenId, reactionTimeMicroseconds);
    }

    // Fallback function to receive Ether
    receive() external payable {}

    // Function to withdraw contract balance (only by owner)
    function withdraw() external onlyOwner {
        payable(owner).transfer(address(this).balance);
    }
}

